import { checkPropTypes } from "prop-types";

function Naveen(props){
    return(
        <div>
            <p>
                
                Firstname:{props.fname}<br></br>
                Lastname:{props.Lname}<br></br>
                Age:{props.age}<br></br>
                City:{props.city}


            </p>
        </div>
    )
}
export default Naveen;
